import React, { Component, setState } from 'react';
import axios from 'axios';
import logo from './logo.svg';
import './App.css';

const api = axios.create({
  baseURL: `http://www.devcodecampmusiclibrary.com/api/music`
})

class App extends Component {

  state = {
    musicCollection:[]
  }

  constructor() {
    super();
    api.get('/').then(response => {
      console.log(response.data)
      this.setState({ musicCollection: response.data})
    })
  }


  render(){
    return (
    <div className="App">
      <header className="App-header">
        <h3 className="display-1">Music Library Search</h3>
        {this.state.musicCollection.map(music => <h2 key={music.id}>{music.title}</h2>)}
      </header>
    </div>
    )};
}

export default App;
